description:
OK.... first I have a little something to say.... a comment made by someone who shall remain nameless on one of my posts seems to claim that I am re-uploading other peoples torrents.... This has never been nor will it ever be the case. Everything I upload are obtained from my own sources.
I do not check everything uploaded by others and I post stuff that people have asked me for.... So in light of the appreciation shown for my efforts to help people out with their TeenMarvel sets I shall not be posting them anymore. These are my last 4 TeenMarvel items...
If  there are some 40 or so sets that havent been posted I suggest you look for them and post them yourself sir....


